measurements.description:
One flower, two mature buds and one juvenile bud on four pendent sequential-blooming 14-cm inflorescences;



 sepals pale green heavily spotted purple, dorsal caudae pink-orange front, dark purple back, lateral caudae pale green 
 transitioning to dark purple distally; 
 petals minute, pink-orange; striking large lip light orange veined dark burgundy coalescing proximally;

 column cream finely spotted black-purple; substance firm; texture matte.
